import React, { FC } from 'react';

import { Button, PageHeader } from 'antd';

import 'antd/dist/antd.css';
import './header.scss';

const Header: FC = () => (
  <div className="site-page-header-ghost-wrapper">
    <PageHeader
      ghost={false}
      title="Posts search"
      subTitle="You can work w posts here"
      extra={[<Button>По имени</Button>, <Button>По названию</Button>, <Button>По оценке</Button>]}
    ></PageHeader>
  </div>
);

export default Header;
